 "<p>DropDown exercises are texts or sentences where students must select the correct words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>Os exercicios nos que se utiliza a Actividade despregable son textos ou oraci\u00f3ns onde os estudantes deben elixir as palabras correctas. Este tipo de exercicios util\u00edzanse a mi\u00fado cos seguintes obxectivos:<\/p><ol><li>Para comprobar os co\u00f1ecementos dos conceptos chave dun curso (poder\u00eda tratarse dun control previo, unha proba formativa ou unha proba sumativa).<\/li><li>Para comprobar a comprensi\u00f3n lectora<\/li><li>Para comprobar o co\u00f1ecemento do vocabulario.<\/li><li>Para comprobar a competencia morfol\u00f3cia ou gramatical. <\/li><\/ol>", 
