 "Enter an RSS URL for the RSS feed you \nwant to attach to your content. Feeds are often identified by a small graphic\n icon (often like this <img src=\"\/images\/feed-icon.png\" \/>) or the text \"RSS\". Clicking on the \n icon or text label will display an RSS feed right in your browser. You can copy and paste the\nURL into this field. Alternately, right clicking on the link or graphic will open a menu box;\nclick on COPY LINK LOCATION or Copy Shortcut. Back in eXe open the RSS bookmark iDevice and Paste the URL \ninto the RSS URL field and click the LOAD button. This will extract the titles from your feed and\ndisplay them as links in your content. From here you can edit the bookmarks and add\n instructions or additional learning information.": "Introduza o enderezo URL da fonte RSS \nque quere anexar ao seu contido. As fontes est\u00e1n habitualmente identificadas cunha pequena icona gr\u00e1fico \n (como esta <img src=\"\/images\/feed-icon.png\" \/>) ou co texto \"RSS\". Ao premer na \nicona ou na etiqueta de texto mostrar\u00e1selle un f\u00edo RSS no seu navegador. Pode copiar e pegar o\nenderezo URL neste campo. Como alternativa, prema co bot\u00f3n do lado dereito do rato na ligaz\u00f3n ou na icona para abrir unha caixa de men\u00fa;\nprema en COPIAR ENDEREZO DA LIGAZ\u00d3N ou en Copiar atallo. Volte ao eXe, abra o iDevice Marcador de RSS, pegue o enderezo URL\nno campo URL de RSS e prema o bot\u00f3n CARGAR. Isto extrair\u00e1 os t\u00edtulos da s\u00faa fonte RSS\ne ir\u00e1 mostralos como ligaz\u00f3ns na s\u00faa p\u00e1xina. A partir deste paso pode modificar os marcadores e engadir\n instruci\u00f3ns ou m\u00e1is informaci\u00f3n para a aprendizaxe.", 
