 "No Java": "No java", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Select words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dd><p>Write a text using the target vocabulary. This text should be coherent and cohesive, and be of an appropriate length. Highlight the target words in the text. Choose alternatives with one clear answer.<\/p>  <\/dd>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl>  <dt>Se o seu obxectivo \u00e9 probar a comprensi\u00f3n dos conceptos chave ou a verificaci\u00f3n da lectura do aluno<\/dt>  <dd>    <p>  Escriba un resumo do concepto ou da lectura o suficientemente longo como para probar adecuadamente o co\u00f1ecemento do obxectivo, mais o suficientemente curto como para non producir fatiga. Bastar\u00e1 normalmente con menos dunha p\u00e1xina, mais pode ser a\u00ednda menos no caso de estudantes novos ou principiantes.    <\/p>    <p>Seleccione as palabras chave no texto para a comprensi\u00f3n dos conceptos. Estas palabras chave ser\u00e1n probabelmente verbos, nomes, e adverbios. Escolla alternativas cunha resposta clara.    <\/p>  <\/dd>  <dt> Se o seu objectivo \u00e9 probar o co\u00f1ecemento do vocabulario  <\/dt>  <dd><p> Escriba un texto usando o vocabulario de destino. Este texto debe ser coherente, cohesivo e ter a extensi\u00f3n apropiada. Realce as palabras chave no texto. Escolla alternativas cunha resposta clara.<\/p>  <\/dd>  <dt> Se o seu obxectivo \u00e9 verificar a formaci\u00f3n sint\u00e1ctica ou gramatical:  <\/dt>  <dd>  <p>Escriba un texto usando as palabras de destino. Este texto debe ser coherente, cohesivo e ter a extensi\u00f3n apropiada. Recorde que o obxectivo non \u00e9 o co\u00f1ecemento do vocabulario, as\u00ed que o significado esencial da ra\u00edz das palabras deber\u00eda ser ben co\u00f1ecida polos estudantes.  <\/p>  <p>Realce as palabras chave no texto. Proporcione alternativas coa mesma palabra ra\u00edz, mais con diferentes afixos. \u00c9 unha boa idea pedirlle a un colega que probe o exercicio para garantir que non hai sorpresas!  <\/p>  <\/dd><\/dl>", 
