 "<p>Teachers should keep the following in mind when using this iDevice: <\/p><ol><li>Think about the number of different types of activity planned for your resource that will be visually signalled in the content. Avoid using too many different types or classification of activities otherwise learner may become confused. Usually three or four different types are more than adequate for a teaching resource.<\/li><li>From a visual design perspective, avoid having two iDevices immediately following each other without any text in between. If this is required, rather collapse two questions or events into one iDevice. <\/li><li>Think about activities where the perceived benefit of doing the activity outweighs the time and effort it will take to complete the activity. <\/li><\/ol>": "<p>Os profesores debe lembrarse do seguinte cando usen este iDevice: <\/p><ol><li>Pensar sobre os diferentes tipos de actividades planificadas para o seu recurso que ser\u00e1n sinaladas visualmente no contido. Evitar o uso de demasiados tipos ou clasificaci\u00f3ns de actividades, o que poder\u00eda confundir o alumno. Normalmente tres ou catro tipos de actividades son m\u00e1is que suficientes para un recurso de ensino.<\/li><li> Do punto de vista do dese\u00f1o visual, hai que evitar ter dous iDevices seguidos un do outro sen ning\u00fan texto entre eles. Se \u00e9 necesario, en vez diso una d\u00faas preguntas ou eventos nun \u00fanico iDevice. <\/li><li>Pense en actividades en que o beneficio percibido de realizar a actividade sexa maior do que o tempo e o esforzo necesarios para completar a actividade. <\/li><\/ol>", 
