 "Type in the feedback that you want the \nstudent to see when selecting the particular question. If you don't complete\nthis box, eXe will automatically provide default feedback as follows: \n\"Correct answer\" as indicated by the selection for the correct answer; or \n\"Wrong answer\" for the other alternatives.": "Escriba a retroacci\u00f3n que quere que \no alumno vexa cando seleccione unha opci\u00f3n en particular. Se non enche esta caixa de texto, \no eXe proporcionar\u00e1 automaticamente a retroacci\u00f3n predeterminada como sigue: \"Resposta correcta\" \ncomo indicada pola selecci\u00f3n da resposta correcta, ou \"Resposta errada\"\npara as outras opci\u00f3ns.", 
