 "Role": "Rol", 
 "Insert Column After": "Insertar columna (desp\u00f3is)", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Choose words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl><dt>Se o seu obxectivo \u00e9 avaliar a comprensi\u00f3n dos conceptos chave dun curso ou a comprensi\u00f3n lectora<\/dt><dd><p>Escriba un resumo do concepto ou lectura o suficientemente longo como para que se aval\u00ede adecuadamente o co\u00f1ecemento do obxectivo, pero o suficientemente curto como para que non produza fatiga. Probablemente unha p\u00e1xina impresa sexa un tama\u00f1o axeitado, pero considere a posibilidade de utilizar un texto menor para os nenos ou participantes.<\/p> <p>Escolla as palabras do texto que sexan chave para a comprensi\u00f3n dos conceptos. Estas ser\u00e1n probablemente verbos, sustantivos e adverbios chave. Escolla alternativas con unha resposta clara.<\/p><\/dd> <dt>Se o seu obxectivo \u00e9 avaliar o co\u00f1ecemento de vocabulario<\/dt><dt>Se o seu obxectivo \u00e9 avaliar morfolox\u00eda ou gram\u00e1tica: <\/dt><dd><p>Escriba un texto no que se utilicen as formas que quere avaliar. Este texto debe ser coherente e ter sentido completo, dunha lonxitude axeitada. Recorde que neste caso o obxectivo non \u00e9 avaliar o co\u00f1ecemento de vocabulario, e polo tanto os significados b\u00e1sicos das ra\u00edces deben ser ben co\u00f1ecidos polos estudantes. \u00c9 boa idea pedir a un compa\u00f1eiro docente que realice o control\/exercicio, para asegurarse de que non se producen sorpresas!<\/p><\/dd><\/dl>", 
