 "A case study is a device that provides learners \nwith a simulation that has an educational basis. It takes a situation, generally \nbased in reality, and asks learners to demonstrate or describe what action they \nwould take to complete a task or resolve a situation. The case study allows \nlearners apply their own knowledge and experience to completing the tasks \nassigned. when designing a case study consider the following:<ul> \n<li>\tWhat educational points are conveyed in the story<\/li>\n<li>\tWhat preparation will the learners need to do prior to working on the \ncase study<\/li>\n<li>\tWhere the case study fits into the rest of the course<\/li>\n<li>\tHow the learners will interact with the materials and each other e.g.\nif run in a classroom situation can teams be setup to work on different aspects\nof the case and if so how are ideas feed back to the class<\/li><\/ul>": "Un estudo de caso \u00e9 un dispositivo que lle fornece aos alumnos \nunha simulaci\u00f3n que ten unha base educacional, xeralmente \nbaseada na realidade, e que lles solicita aos alumnos que demostren ou describan a acci\u00f3n que \nseguir\u00edan para completar unha tarefa ou para resolver unha situaci\u00f3n. O caso de estudo perm\u00edtelle \naos alumnos aplicar o seu propio co\u00f1ecemento e experiencia para terminaren as tarefas \nasignadas. Ao dese\u00f1ar un estudo de caso considere os seguintes aspectos:<ul> \n<li>\tQue puntos educacionais se transmiten na historia?<\/li>\n<li>\tQue preparaci\u00f3n precisan os alumnos antes de traballaren no \nestudo de caso?<\/li>\n<li>\tOnde encaixa o estudo de caso en relaci\u00f3n co resto do curso?<\/li>\n<li>\tComo interactuar\u00e1n os alumnos cos materiais e entre eles? Por exemplo: \nNo caso de estaren nunha aula, p\u00f3dense definir equipos que traballen en diferentes tarefas\ndo estudo de caso e en caso afirmativo, como son transmitidas de volta as ideas \u00e1 clase?<\/li><\/ul>", 
