 "<p>The reading activity, as the name \nsuggests, should ask the learner to perform some form of activity. This activity \nshould be directly related to the text the learner has been asked to read. \nFeedback to the activity where appropriate, can provide the learner with some \nreflective guidance.<\/p>": "<p>A actividade de lectura, como o seu nome \nindica, deber\u00eda suxerirlle ao alumno a realizaci\u00f3n dun tipo de actividade. Esta actividade \ndeber\u00eda estar directamente relacionada co texto que se lle indicou como lectura. \nA retroacci\u00f3n na actividade, cando \u00e9 apropiada, p\u00f3delle fornecer ao alumno unha \norientaci\u00f3n para a reflexi\u00f3n.<\/p>", 
