 "Bosnian ": "Bosnio ", 
 "<p>\nThe image with text iDevice can be used in a number of ways to support both\nthe emotional (affective) and learning task (cognitive) dimensions of eXe\ncontent. \n<\/p><p>\n<b>Integrating visuals with verbal summaries<\/b>\n<\/p><p>\nCognitive psychologists indicate that presenting learners with a\nrepresentative image and corresponding verbal summary (that is presented\nsimultaneously) can reduce cognitive load and enhance learning retention.\nThis iDevice can be used to present an image (photograph, diagram or\ngraphic) with a brief verbal summary covering the main points relating to\nthe image. For example, if you were teaching the functions of a four-stroke\ncombustion engine, you could have a visual for each of the four positions of\nthe piston with a brief textual summary of the key aspects of each visual.\n<\/p>": "<p>\nA imaxe cun iDevice de texto p\u00f3dese usar de varias maneiras para soportar as dimensi\u00f3ns\n emocional (afectiva) e a de tarefas de aprendizaxe (cognitiva) do contido\ndo eXe. \n<\/p><p>\n<b>Integrar imaxes con descrici\u00f3ns<\/b>\n<\/p><p>\nOs psic\u00f3logos cognitivistas indican que mostrarlle ao alumnos unha\nimaxe representativa e a correspondente descrici\u00f3n  (presentados \nsimultaneamente) pode reducir a carga cognitiva e mellorar a retenci\u00f3n da aprendizaxe.\nEste obxecto iDevice p\u00f3dese usar para presentar unha imaxe (unha fotograf\u00eda, un diagrama ou un\ngr\u00e1fico) cunha descrici\u00f3n curta que cubra os principais puntos relacionados coa\nimaxe. Por exemplo, se estiver ensinando as funci\u00f3ns dun motor de combusti\u00f3n de\ncatro tempos, poder\u00eda inclu\u00edr unha imaxe para cada unha das catro posici\u00f3ns do\npist\u00f3n cun breve texto descritivo dos aspectos chave de cada imaxe.\n<\/p>", 
 "<p>Cloze exercises are texts or sentences where students must fill in missing words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>Os exercicios de espazos baleiros son textos ou frases en que os estudantes deben encher os espazos coas palabras que faltan. \u00dasanse normalmente coas seguintes finalidades:<\/p><ol><li>Para verificar o co\u00f1ecemento dos conceptos chave dun curso (poder\u00eda ser un test de preco\u00f1ecemento, un exercicio formativo ou unha verificaci\u00f3n sumativa).<\/li><li>Para verificar a comprensi\u00f3n lectora.<\/li><li>Para verificar os co\u00f1ecementos de vocabulario.<\/li><li>Para verificar a formaci\u00f3n de palabras ou a competencia gramatical. <\/li><\/ol>", 
